import React from "react";

function GameCard({game}) {
    return (
        <span id="gameIm" >
            <h4>{game.name}</h4>
            <img src={game.image} alt={game.name} />
            <p>{game.description}</p>
            <p>Players Needed: {game.playersNeeded}</p>
            <p>Genre: {game.genre}</p>
        </span>
    )
}

export default GameCard;
